import React from 'react';

interface InputProps {
    placeholder: string;
    type: string;
    error?: string;
    onChange: (value: string) => any
}

const InputModel: React.FC<InputProps> = ({ placeholder, type, error, onChange }) => {

    const handleChange = (event: React.ChangeEvent<HTMLInputElement>) => {
        const { value } = event.target;
        onChange(value); 
    }
    
    return (

        <div className="my-10">
            <input
                placeholder={placeholder}
                type={type}
                className="p-5 w-full bg-slate-100 rounded-xl placeholder:text-lg"
           
                
            />
            {error && <div>{error}</div>} 

        </div>
    );
};

export default InputModel;
